import ListSubheader from '@material-ui/core/ListSubheader';
import IconButton from '@material-ui/core/IconButton';

const Project = (props) => {

    return <GridList cellHeight={180}>
        <GridListTile cols={2}>
            <ListSubheader component="div"><h1>Projects</h1></ListSubheader>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
        <GridListTile>
            <img src = "https://via.placeholder.com/100" alt="project-pic"></img>
        </GridListTile>
